import React, { Component } from "react";
import Home from "./component/Timekeeping/Home";
import MenuHorizontal from "./component/Menu/MenuHorizontal";
import { Switch, Route } from "react-router-dom";
import Add from "./component/Timekeeping/Add";
import Edit from "./component/Timekeeping/Edit";
import House from "./component/House/House";
import List from "./component/Employee/List";
import EditEmployee from "./component/Employee/Edit";

class App extends Component {
  render() {
    return (
      <div>

        <div className="container">
        </div>
        <Switch>
          <Route exact path="/" >

            <MenuHorizontal />
            <House/>
            </Route>
          <Route exact path="/add" component={Add}/>
          <Route exact path="/edit/:id" component={Edit} />
          <Route exact path="/house" component={House} />
          <Route exact path="/home" component={Home} />
          <Route exact path="/list" component={List} />
          <Route exact path="/edit/:id" component={EditEmployee} />

        </Switch>
      </div>
    );
  }
}

export default App;
